        //await JSRuntime.InvokeAsync<string>(
        //    "appFunctions.hideEditUserModal", "");

        users = await UserService.SaveUserAsync(SortField, SortDesc, users, SelectedUser);

        await JSRuntime.InvokeAsync<string>(
